import React, { useContext, useState } from "react";
import "./Dashboard.css";
import Main from "../Main/Main";
import CreateProposal from "./CreateProposal/CreateProposal";
import ExecuteProposal from "./ExecuteProposal/ExecuteProposal";
import TransferShares from "./TransferShares/TransferShares";
import RedeemShares from "./RedeemShares/RedeemShares";
import { ComponentContext } from "../../ComponentContext/ComponentContext";

const Dashboard = () => {
  const [activeComponent, setActiveComponent] = useState("");

  const setComponent = useContext(ComponentContext);

  if (activeComponent === "Create Proposal") {
    console.log("Create Proposal");
    setComponent(<CreateProposal />);
  } else if (activeComponent === "Excecute Proposal") {
    console.log("Execute Proposal");
    setComponent(<ExecuteProposal />);
  } else if (activeComponent === "Transfer Shares") {
    console.log("Transfer Shares");
    setComponent(<TransferShares />);
  } else if (activeComponent === "Redeem Shares") {
    console.log("Redeem Shares");
    setComponent(<RedeemShares />);
  }

  return (
    <div>
      <aside>
        <div onClick={() => setActiveComponent("Create Proposal")}>
          <p>Create Proposal</p>
        </div>
        <div onClick={() => setActiveComponent("Excecute Proposal")}>
          <p>Execute Proposal</p>
        </div>
        <div onClick={() => setActiveComponent("Transfer Shares")}>
          <p>Transfer Shares</p>
        </div>
        <div onClick={() => setActiveComponent("Redeem Shares")}>
          <p>Redeem Shares</p>
        </div>
      </aside>
    </div>
  );
};
export default Dashboard;
